    weight: 270-550 g
    size: 32-40 cm
    food: Dives for aquatic invertebrates and small fish
    species: Bucephala albeola
    color: 'a mix of gray, black, white, brown'
    reproduction: oviparus
    offsprings: Clutch size of 6-11 eggs
    class: bird
